VALUES ('9400740613187', 'Chia', 'FR: Le Chia est une herbe d\'Amérique du Sud. Depuis des siècles, la graine est reconnue comme un aliment incontournable. La graine de chia offre de nature dans un rapport équilibré une multitude d\'éléments nutritifs et phytonutriments. Les graines de chia de Purasana sont non traitées et ne contiennent aucun additif. Les graines de chia sont une source d\'acides gras oméga-3, de vitamines et minéraux et elles sont riches en fibre. Consommer max. 15 g par jour.lngrédients: 100% graines de chia (Salvia hispanica) bruts et biologiques du Paraguay. À conserver au sec & bien refermer le sachet après chaque utilisation. A consommer de préférence avant fin - NO de lot: voir emballage.', 'https://static.openfoodfacts.org/images/products/940/074/061/3187/front_fr.4.400.jpg', '31.4', '3.8', '4.9', '0.8', '33.7', '21.2', '0.02', '0.0078740157480315', '', '1');

